  [],\n\t\"revision_timestamp\": \"2016-10-08T14:53:47.287843\",\n\t\"name\": \"hcup-nationwide-emergency-department-database-neds-restricted-access-file\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Nationwide Emergency Department Sample
  (NEDS) was created to enable analyses of emergency department (ED) utilization patterns
  and support public health professionals, administrators, policymakers, and clinicians
  in their decision-making regarding this critical source of care. The NEDS can be
  weighted to produce national estimates.  Restricted access data files are available
  with a data use agreement and brief online security training.</p>n<p>The NEDS is
  the largest all-payer ED database in the United States.  It was constructed using
  records from both the HCUP State Emergency Department Databases (SEDD) and the State
  Inpatient Databases (SID), both also described in healthdata.gov. The SEDD capture
  information on ED visits that do not result in an admission (i.e., treat-and-release
  visits and transfers to another hospital). The SID contain information on patients
  initially seen in the emergency room and then admitted to the same hospital.</p>n<p>The
  NEDS contains 25-30 million (unweighted) records for ED visits for over 950 hospitals
  and approximates a 20-percent stratified sample of U.S. hospital-based EDs.</p>n<p>The
  NEDS contains information about geographic characteristics, hospital characteristics,
  patient characteristics, and the nature of visits (e.g., common reasons for ED visits,
  including injuries).   The NEDS contains clinical and resource use information included
  in a typical discharge abstract, with safeguards to protect the privacy of individual
  patients, physicians, and hospitals (as required by data sources). It includes ED
  charge information for over 85% of patients, regardless of payer, including patients
  covered by Medicaid, private insurance, and the uninsured. The NEDS excludes data
  elements that could directly or indirectly identify individuals, hospitals, or states.</p>n\",\n\t\"license_title\":
